    return (
        <main role="main" class="main-content" id="main-content">
    <div class="titleCont">
        <h1 class="main-title" id="main-title">
            "Here, in the forest,<span style="padding-left:100px">dark and deep,</span><span style="padding-right:110px">I offer you,</span><span style="padding-left:-20px">eternal sleep."</span>
        </h1>
    </div>
    <canvas id="noise" class="noise"></canvas>
  <div class="vignette"></div>
</main>

    )
}
